// SPDX-License-Identifier: MIT
pragma solidity ^0.8.3;

import "../node_modules/@openzeppelin/contracts-upgradeable/token/ERC1155/ERC1155Upgradeable.sol";
import "../node_modules/@openzeppelin/contracts-upgradeable/token/ERC1155/extensions/ERC1155PausableUpgradeable.sol";
import "../node_modules/@openzeppelin/contracts-upgradeable/token/ERC1155/extensions/ERC1155BurnableUpgradeable.sol";
import "../node_modules/@openzeppelin/contracts-upgradeable/access/AccessControlEnumerableUpgradeable.sol";
import "../node_modules/@openzeppelin/contracts-upgradeable/utils/ContextUpgradeable.sol";
import "../node_modules/@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";

contract ERC1155Token is Initializable, ContextUpgradeable, AccessControlEnumerableUpgradeable, ERC1155BurnableUpgradeable, ERC1155PausableUpgradeable {

  bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");

  function __ERC1155Token_init(string memory uri, address minter) internal initializer {
    __Context_init_unchained();
    __ERC165_init_unchained();
    __AccessControl_init_unchained();
    __AccessControlEnumerable_init_unchained();
    __ERC1155_init_unchained(uri);
    __ERC1155Burnable_init_unchained();
    __Pausable_init_unchained();
    __ERC1155Pausable_init_unchained();
    __ERC1155Token_init_unchained(minter);
  }

  function __ERC1155Token_init_unchained(address minter) internal initializer {
    _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());
    _setupRole(MINTER_ROLE, minter);
  }

  function pause() public {
    require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), "ERC1155Token: must have admin role to pause");
    _pause();
  }

  function unpause() public {
    require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), "ERC1155Token: must have admin role to unpause");
    _unpause();
  }

  function supportsInterface(bytes4 interfaceId) public view override(AccessControlEnumerableUpgradeable, ERC1155Upgradeable) returns (bool) {
    return super.supportsInterface(interfaceId);
  }

  function _beforeTokenTransfer(
      address operator,
      address from,
      address to,
      uint256[] memory ids,
      uint256[] memory amounts,
      bytes memory data
  )
      internal override(ERC1155Upgradeable, ERC1155PausableUpgradeable)
  {
      super._beforeTokenTransfer(operator, from, to, ids, amounts, data);
  }
  uint256[50] private __gap;
}
